import React from 'react'
import Wrapper from '../components/Wrapper'
import AdminTabs from '../components/AdminTabs'

const Admin = () => {
	return (
		<Wrapper>
			<h1>Administrator Oversikt</h1>
			<AdminTabs />
		</Wrapper>
	)
}

export default Admin
